import React from "react";
import "./main.css";

const Box = (props) => {
  const isBtn = props.btn;
  const style_name = props.styleName;
  return (
    <div className="box">
      {style_name}
      <img src={props.img} alt="image loading" />
      <div className="content">
        <h3>{props.place}</h3>
        <p>{props.data}</p>

        {isBtn && (
          <a href={props.link} className="btn">
            see more
          </a>
        )}
      </div>
    </div>
  );
};

export default Box;
